          }
          function Faisalabad(){
            alert("Special Dish: Daal Chawal \nFamous place in Faisalabad: 1) Clock Tower 2) Jinnah Garden 3) Gatwala Wildlife Park")
          }
          function Sialkot(){
            alert("Special Dish: Tandoori Chicken \nFamous place in Sialkot: 1) Iqbal Manzil 2) Marala Headworks 3) Sialkot Fort")
          }
          
    return(
        <>
